import React from "react";

class ImageUpload extends React.Component {
    render() {
      return <div>
            <label>Upload Image</label>
            <input type="file" id="image" name="image"/>
            <input type="submit" value="Upload" />
        </div>
    }
}

export default ImageUpload;
